import React, { Fragment } from 'react';
import withAuth from '../../src/helpers/withAuth';
import NavDashboard from '../../src/components/Controls/NavDashboard';

const Dashboard = () => {
  return (
      <Fragment>
        <NavDashboard />
        <div className="bg-gray-900 border border-gray-800 rounded shadow p-2">
          <div className="flex flex-row items-center">
            <div className="flex-shrink pr-4">
              <div className="rounded p-3 bg-green-600"><i className="fa fa-wallet fa-2x fa-fw fa-inverse" /></div>
            </div>
            <div className="flex-1 text-right md:text-center">
              <h5 className="font-bold uppercase text-gray-400">Total Revenue</h5>
              <h3 className="font-bold text-3xl text-gray-600">$3249 <span className="text-green-500"><i
                  className="fas fa-caret-up" /></span></h3>
            </div>
          </div>
        </div>
      </Fragment>
  );
};

export default withAuth(Dashboard);
